import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return (
        <ContactsContainer>
            <h1>Contacts</h1>
            <Img src="/iPhoneImage/iPhoneImage.svg" alt="iPhone-image"></Img>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 80%;
    height: 100vh;
    margin: 0px auto;
`

const Img = styled.img`
    width: 437px;
    height: 882px;
`  

export default Contacts
